pragma solidity ^0.8.9;

/**
 * @title DataTypes
 * @author Pomp Protocol
 *
 * @notice A standard library of data types used throughout the Pomp Protocol.
 */
library DataTypes {
  /**
   * @notice An enum containing the different states the protocol can be in, limiting certain actions.
   *
   * @param Unpaused The fully unpaused state.
   * @param Paused The fully paused state.
   */
  enum ProtocolState {
    Unpaused,
    Paused
  }

  enum State {
    nftDeposited,
    aborted,
    completed,
    verified,
    failed
  }

  struct MissionStruct {
    address owner;
    uint256 profileId;
    uint256 missionId;
    address verifier;
    uint256 starttime;
    uint256 endtime;
    bytes32 challengeHash;
    State state;
  }

  /**
   * @notice Profile
   *
   * @param missionCount number of missions of profile started
   * @param handle Profile handle, max-32 lowercase alphanumeric chars
   */
  struct ProfileStruct {
    uint256 missionCount;
    string handle;
    address owner;
  }

  /**
   * @notice Argument to abort mission with EIP-712 signature
   *
   * @param requester Requester address
   * @param profileId
   * @param missionId
   * @param signature The signature to reconstruct an EIP-712 typed data signature
   * @param deadline The signature's deadline to reconstruct an EIP-712 typed data signature
   */
  struct AbortWithSigData {
    uint256 profileId;
    uint256 missionId;
    bytes signature;
    uint256 deadline;
  }

  struct BurnWithSigData {
    uint256 missionId;
    bytes signature;
    uint256 deadline;
  }

  /**
   * @notice Argument to complete mission with EIP-712 signature
   *
   * @param requester Requester address
   * @param profileId
   * @param missionId
   * @param signature The signature to reconstruct an EIP-712 typed data signature
   * @param deadline The signature's deadline to reconstruct an EIP-712 typed data signature
   */
  struct CompleteWithSigData {
    uint256 profileId;
    uint256 missionId;
    string challenge;
    bytes signature;
    uint256 deadline;
  }

  struct StartWithSigData {
    uint256 profileId;
    string slug;
    string contentURI;
    uint256 minutesToExpire;
    address verifier;
    bytes signature;
    uint256 deadline;
  }

  struct VerifyWithSigData {
    uint256 profileId;
    string challenge;
    bytes signature;
    uint256 deadline;
  }

  struct FailWithSigData {
    uint256 profileId;
    string challenge;
    string reason;
    bytes signature;
    uint256 deadline;
  }
}
